src/operations/update/.body:
update(object, path, update) ⇒ Object | Array.
Sometimes we need to set new value depends on previous value.
Here update() operation can help.
Returns: Object | Array. - updated object
Params

object Object | Array. - object to update
path string | Array. - path to be updated
(array of items or dot-separated string can be provided)
update function - function to update value

Description
import { update } from 'immutable-object-update';

const state = {
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 4
    }
};

const increment = oldValue => oldValue + 1;
const updated = update(state, [ 'b', 'b1' ], increment);

// or

const updated = update(state, 'b.b1', increment);

As a result we will receive new object with structure below:
{
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 4,
        b2: 5
    }
}

src/functional/apply/.body:
apply(object, ...ops) ⇒ Object | Array.
apply() function can help to apply several operations at once:
Returns: Object | Array. - updated object
Params

object Object | Array. - object to updates
...ops function - ops to apply

Description
import { apply, set } from 'immutable-object-update';

const state = {
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 4
    }
};

const setA1to10 = set('a.a1', 10);
const setB1to30 = set('b.b1', 30);

const updated = apply(state, setA1to10, setB1to30);

As a result we will receive new object with structure below:
{
    a: {
        a1: 10,
        a2: 2
    },
    b: {
        b1: 30,
        b2: 5
    }
}

apply() can also apply a list of operations with the same result:
const updated = apply(state, [ setA1to10, setB1to30 ]);

And even many of those:
const updated = apply(state, [ setA1to10, setB1to30 ], [ setCto50 ]);

src/functional/pipe/.body:
pipe(...ops) ⇒ function
Combines several operations into one (to upply later)
Returns: function - combined update operation
Params

...ops function - operations to combine

Description
import { pipe, set } from 'immutable-object-update';

const state = {
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 4
    }
};

const setA1to10andB1to30 = pipe(
    set('a.a1', 10),
    set('b.b1', 30)
);

const updated = setA1to10andB1to30(state);

As a result we will receive new object with structure below:
{
    a: {
        a1: 10,
        a2: 2
    },
    b: {
        b1: 30,
        b2: 5
    }
}
